import React, { Component } from "react";
import OpenShiftInfo from "./Pages/OpenShiftInfo";
import OpenStackInfo from "./Pages/OpenStackInfo";
// import { Route, Switch } from "react-router-dom";

const horizontal = {
  display: "flex",
  flexDirection: "row",
  flexWrap: "wrap"
}

class App extends Component {
  render() {
    return (
      <div className="App">
        <header className="App-header">
          <center>
            <h1>Hello React Dashboard being made by Nikunj Doshi </h1>
          </center>
        </header>
        <div style={horizontal}>
          <OpenShiftInfo displayMessage="APP -> OpenShift" />
          <OpenStackInfo displayMessage="APP -> OpenStack" />
        </div>
      </div>
    );
  }
}

export default App;
